import React, {Component} from "react"

class Form extends Component {
    constructor() {
        super()
        this.state = {
            Gender: "Man",
            Orientation: "Hetrosexual"
        }
        this.clickHandler = this.clickHandler.bind(this)
    }

    clickHandler(event) {
        this.setState({
            Gender: event,
            Orientation: event
        })
    }

    render() {
        return (
            <form>
                <label>How do you identify yourself: </label>
                <button onClick={this.clickHandler}>Man</button>
                <button onClick={this.clickHandler}>Woman</button><br></br>

                <label>Your sexual orientation</label>
                <button onClick={this.clickHandler}>Hetrosexual</button>
                <button onClick={this.clickHandler}>Bisexual</button><br></br>
            </form>
        )
    }
}

export default Form
